import React from 'react';
import { Route, Switch } from 'react-router-dom';
import HomePage from './pages/HomePage';
import PhotoPage from './pages/PhotoPage';
// import ResetModal from './containers/ResetModal';



export default class Router extends React.Component {
    render(){
        const {users}=this.props;
        return(
            <div>
                <Switch>
                    <Route exact path="/" component={props=><HomePage users={users}{...props} />} />
                    <Route path="/photo" component={props=><PhotoPage {...props} />} />
                    {/* <Route path="/reset" component={props=><ResetModal {...props} />} /> */}
                </Switch>
            </div>
        )
    }
}
